
import React, { Component } from 'react';
import {
    AppRegistry,
    StyleSheet,
    Text,
    View,
    TabBarIOS,
    AsyncStorage
} from 'react-native';

import CMUMap from './ios_views/CMUMap';
import Read from './ios_views/read';
import Setting from './ios_views/setting';
import Entertainment from './ios_views/entertainment';

var img1_base64 = 'data:image/png;base64,';
var img2_base64 = 'data:image/png;base64,';
var img3_base64 = 'data:image/png;base64,';
//var img3_base64 = 'data:image/png;base64,';
var img4_base64 = 'data:image/png;base64,';


    class MyApp extends Component{
     constructor(props) {
        super(props);
        this.state = {
            selectedTab: 'map',
        };
    }

    render() {
        return (
            <TabBarIOS barTintColor="#fff" >
              <TabBarIOS.Item
                  title="Map"
                  selected={this.state.selectedTab === 'map'}
                  //icon={require('image!toilet')}
                  icon={{uri: img1_base64, scale:3.5}}
                  onPress={() => {
                      this.setState({
                          selectedTab: 'map'
                      });
                  }}>
                  {this._renderView()}
              </TabBarIOS.Item>
              <TabBarIOS.Item
                  title="Reading"
                  selected={this.state.selectedTab === 'read'}
                  //icon={require('image!read')}
                  icon={{uri: img2_base64, scale:3.5}}
                  onPress={() => {
                      this.setState({
                          selectedTab: 'read'
                      });
                  }}>
                  {this._renderView()}
              </TabBarIOS.Item>
              <TabBarIOS.Item
                  title="Entertainment"
                  selected={this.state.selectedTab === 'enter'}
                  //icon={require('image!weather_ic')}
                  icon={{uri: img3_base64, scale:3.5}}
                  onPress={() => {
                      this.setState({
                          selectedTab: 'enter'
                      });
                  }}>
                  {this._renderView()}
              </TabBarIOS.Item>
              <TabBarIOS.Item
                  title="Setting"
                  selected={this.state.selectedTab === 'setting'}
                  //icon={require('image!setting')}
                  icon={{uri: img4_base64, scale:3.5}}
                  onPress={() => {
                      this.setState({
                          selectedTab: 'setting'
                      });
                  }}>
                  {this._renderView()}
              </TabBarIOS.Item>
            </TabBarIOS>
        );
    }

    _renderView(){
        var view = null;
        switch (this.state.selectedTab){
            case 'map':
                view = <CMUMap ></CMUMap>;
                break;
            case 'read':
                view = <Read></Read>;
                break;
            case 'setting':
                view = <Setting></Setting>
                break;
            default :
                view = <Entertainment></Entertainment>;
                break;
        }
        return view;
    }

}

module.exports=MyApp;
AppRegistry.registerComponent('MyApp', () => MyApp);
